import axios from "axios";

export const axiosNhl = axios.create({
  baseURL: "https://api-web.nhle.com/v1",
  headers: {'Content-Type': 'application/json;charset=UTF-8','Access-Control-Allow-Origin' : '*', 'Access-Control-Allow-Headers': 'origin'}
});
